import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-f13e2f90a759d",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/yonekurayuuki/github/tcsympo2019/README.md").then(comp => {
        Vue.component("v-f13e2f90a759d", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-f4093ecaec484",
    path: "/about.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/yonekurayuuki/github/tcsympo2019/about.md").then(comp => {
        Vue.component("v-f4093ecaec484", comp.default)
        next()
      })
    }
  },
  {
    name: "v-799ec717fe814",
    path: "/contents/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/yonekurayuuki/github/tcsympo2019/contents/README.md").then(comp => {
        Vue.component("v-799ec717fe814", comp.default)
        next()
      })
    }
  },
  {
    path: "/contents/index.html",
    redirect: "/contents/"
  },
  {
    name: "v-f0d4915a5c5d1",
    path: "/contents/page-1.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/yonekurayuuki/github/tcsympo2019/contents/page-1.md").then(comp => {
        Vue.component("v-f0d4915a5c5d1", comp.default)
        next()
      })
    }
  },
  {
    name: "v-f8ff2701b1ae7",
    path: "/me.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/yonekurayuuki/github/tcsympo2019/me.md").then(comp => {
        Vue.component("v-f8ff2701b1ae7", comp.default)
        next()
      })
    }
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
